import React from "react";

const VideoItem = ({video,onVideoSelect}) => {
  return (
      <div className="item fontifyH video-item" onClick={()=>onVideoSelect(video)}>
        <img
            className="ui image"
            src={video.snippet.thumbnails.medium.url}
            alt="404"
        />
          <div className="content">
              <div>{video.snippet.title}</div>
              <div className="description fontifyr">Channel: {video.snippet.channelTitle}</div>
          </div>
      </div>
  )
};

export default VideoItem;
